import "../data/fakedata.json"

function FindSrc(assetName) {
    fakedata.forEach(function (fakePepe) {
        // If asset is in fakeData
        if((assetName) && (assetName == fakePepe["asset"])) {
            return fakePepe["src"]
        }
    })

    return "null"
}

export default FindSrc
